const Navbar = () => {

  return (
    <div className="navbar">
      <a href='#top'>ABE CHOI</a>
      <ul>
        <li><a href="#projects">PROJECTS</a></li>
        <li><a href="#blogs">BLOGS</a></li>
        <li><a href="#docs">DOCS</a></li>
        <li><a href="#about">ABOUT</a></li>
        <li><a href="#social">SOCIAL</a></li>
      </ul>
    </div>
  );
}

export default Navbar;
